tables.table_schema:
CREATE TABLE GeneEditingTechniques ( 
  technique_id SERIAL PRIMARY KEY, 
  technique_name VARCHAR(50) NOT NULL, 
  target_gene VARCHAR(50), 
  modification_type VARCHAR(50) 
);

CREATE TABLE GeneEditingOutcomes ( 
  outcome_id SERIAL PRIMARY KEY, 
  technique_id INTEGER REFERENCES GeneEditingTechniques(technique_id), 
  edited_gene VARCHAR(50) NOT NULL, 
  success BOOLEAN 
);

CREATE TABLE GeneEditingTechniques (
    technique_id INT PRIMARY KEY,
    technique_name TEXT,
    description TEXT,
    target_genes TEXT
);

CREATE TABLE ResearcherInfo (
    researcher_id INT PRIMARY KEY,
    researcher_name TEXT,
    expertise TEXT,
    contact_email TEXT
);
